import React from 'react';

import Sections from './Components/Sections';
import Main from './Components/Main';
import { observer } from 'mobx-react';
import Store from './Store';
import './App.css';

@observer
class App extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <Sections />
        <Main />
      </div>
    );
  }
}

export default App;
